(1, 1, 'Enseñanza', '6', '17', 'Firmar contrato \r\nCopia del certificado de nacimiento\r\nCopia del PDi del encargado\r\nFotografía digital del atleta', '1. Gorra de Natación\r\n2. Lentes acuáticos \r\n3. Traje de baño de una sola pieza para mujeres / calzoneta tipo licra para varones', 'Dentro del marco del periodo vacacional escolar, se establece el espacio para fomentar la práctica de la natación y las habilidades motrices como medio de incursionarse en el deporte acuático.', NULL, NULL, 1, '2023-10-10 19:22:08', '2023-10-10 19:22:08'),
(2, 2, 'Caracolitos', '06', '1.6', 'Fe de edad\r\ntarjeta de vacunación\r\nDPI del encargado', NULL, 'Categoría de Matronatación: esta categoría es comprendida entre las edades de: \r\nDe 6 meses a 1 año y medio', NULL, NULL, 1, '2023-10-11 02:49:19', '2023-10-11 03:03:59'),
(3, 2, 'Pulpitos', '1.6', '3', 'Documentos a presentar en formato PDF \r\n-Contrato llenado a mano y firmado\r\n-Copia de certificado de nacimiento del atleta\r\n-Copia del DPI del encargado\r\n-Fotografía del atleta', '- Gorra de natación\r\n- Lentes acuáticos\r\n- traje de baño de una sola pieza para mujeres \r\n- Calzoneta tipo licra para varones', 'Categoría de pulpitos, esta categoría comprende a niños entre las edades de:\r\nDe 1 año y seis meses a 3 años', NULL, NULL, 1, '2023-10-11 03:14:25', '2023-10-11 03:14:25'),
(4, 2, 'Estrellitas', '4', '5', 'Documentos a adjuntar en forma digital:\r\n- Contrato correspondiente llenado y firmado\r\n- Copia de certificado de nacimiento\r\n- Cartilla de vacunación del atleta\r\n- copia del DPI del encargado\r\n- Fotografía digital del atleta', '- Gorra de natación\r\n. Lentes acuáticos\r\n- traje de baño de una sola pieza para mujeres\r\n- Calzoneta tipo licra para varones', 'Está categoría es para niños comprendidos entre las edades siguientes\r\nDe 4 a 5 años', NULL, NULL, 1, '2023-10-11 03:25:28', '2023-10-11 03:25:28'),
(5, 3, 'Curso Vacacional de Enseñanza  2023', '6', '17', 'Descargar e imprimir el contrato correspondiente, firmarlo y adjuntarlo  a esta misma plataforma en documento PDF, dicho contrato lo encontrara al final de la información \r\nCertificado de nacimiento del atleta en formato PDF.\r\n DPI del encargado de ambos lados en formato PDF.\r\nFotografía digital de medio cuerpo con el rostro descubierto y de frente, preferiblemente con fondo blanco o con colores sólidos.', 'Por seguridad de los niños y atletas, es de carácter obligatorio, al ingresar a la piscina, el uso de:\r\nGorra de natación\r\nLentes de natación\r\nTraje de baño de una sola pieza para mujeres\r\nCalzoneta o short tipo licra para varones\r\nNo está permitido ingresar con zapatos de agua, por lo que deben acudir con ginas', 'Las clases darán inicio:\r\nI) Para el grupo del día sábado: principian el  21/10/23  finalizando el 16/12/2023\r\nII) Para el grupo de los días lunes, miércoles y viernes: principian el 23/10/23  finalizando el 15/12/2023\r\nIII) Para el grupo de los martes y jueves: principian el  24/10/23 finalizando 14/12/2023', '1697055851.jpeg', '1697129155.pdf', 1, '2023-10-11 18:24:11', '2023-10-13 14:19:06'),
(6, 3, 'Curso Vacacional Matronatación - Caracolitos 2023', '0.06', '1.6', 'Descargar e imprimir el contrato correspondiente, firmarlo y adjuntarlo  a esta misma plataforma en documento PDF, dicho contrato lo encontrara al final de la información \r\nCertificado de nacimiento del atleta en formato PDF.\r\n DPI del encargado de ambos lados en formato PDF.\r\nFotografía digital de medio cuerpo con el rostro descubierto y de frente, preferiblemente con fondo blanco o con colores sólidos.', 'Por seguridad de los niños y atletas, es de carácter obligatorio, al ingresar a la piscina, el uso de:\r\nGorra de natación\r\nLentes de natación\r\nTraje de baño de una sola pieza para mujeres\r\nCalzoneta o short tipo licra para varones\r\nNo está permitido ingresar con zapatos de agua, por lo que deben acudir con ginas\r\nPara los encargados o padres de familia que acompañan a la categoría de pulpitos y caracolitos, deberán ingresar a la piscina de forma obligatorio con los  mismos implementos.', 'Las clases darán inicio:\r\nI) Para el grupo del día sábado: principian el  21/10/23  finalizando el 16/12/2023\r\nII) Para el grupo de los días lunes, miércoles y viernes: principian el 23/10/23  finalizando el 15/12/2023\r\nIII) Para el grupo de los martes y jueves: principian el  24/10/23 finalizando 14/12/2023', '1697067920.jpeg', '1697128529.pdf', 1, '2023-10-11 19:59:40', '2023-10-13 14:19:20'),
