INSERT INTO `configs` (`id`, `logo`, `currency`, `currency_simbol`, `email`, `tax_status`, `tax`, `paypal`, `dbt`, `shipping_description`, `contract`, `registration_process`, `payments_description`, `fb_link`, `inst_link`, `yt_link`, `wapp_link`, `created_at`, `updated_at`) VALUES
(1, '1704909723.png', 'GTQ Q', 'Q', 'asoincripciones2023@gmail.com', 0, 0, 0, 0, NULL, '1686765172.pdf', '1. Llenar el presente formulario de inscripción.\r\n2. Imprimir, leer, llenar y firmar el contrato del curso correspondiente (Se adjunta a este mismo formulario el Link de descarga del Contrato en PDF).\r\n3. Realizar el pago del curso en las oficinas de la Asonata Xela. No se aceptan pagos con tarjeta, depósitos o transferencias. \r\n4. Realizar el pago del carnet si este curso lo amerita, con un costo de Q20.00, dicho carnet les exonera 2 horas de parqueo mientras estén en el horario y dentro de las instalaciones de la piscina.', '1. Al ingerir alimentos, tener un lapso prudencial antes de que inicie el horario en que el niño recibirá su clase.\r\n2. Al área de la piscina se entra solo con ginas.\r\n3. De preferencia venir ya con el traje de baño puesto antes de comenzar la clase.\r\n5. No traer objetos de valor ( teléfono, reloj, cadenas entre otros) y hacer maletines con lo esencial.\r\n6. Las maletas y maletines deben dejarse a la vista del atleta o encargado, en el área de los casilleros.\r\n7. Los vestidores o baños no pueden ser apartados, estos se usan conforme los niños van saliendo de la piscina, caso contrario el personal le pedirá retiré sus pertenencias de los mismos. \r\n8. El niño debe tomar, antes y después de ingresar a la piscina, una ducha rápida, con un máximo de 3 minutos por niño, ya que solo es para retirar químicos.  \r\n9. Al retirarse de las instalaciones de la piscina, verificar mis pertenencias, porque la Asonata Xela no se hace responsable por objetos olvidados.\r\n10. Si le es posible, envíe un refrigerio para que el atleta pueda consumir alimentos sanos y energéticos después de su clase.', 'https://www.facebook.com/AsonataXela', 'https://www.instagram.com/asonatacionxela/', 'https://www.youtube.com/@AsonataXela1950', '38711264', '2023-02-13 23:08:39', '2024-01-10 17:02:03');
INSERT INTO `cycles` (`id`, `name`, `start_date`, `end_date`, `description`, `status`, `created_at`, `updated_at`) VALUES
(1, 'Enseñanza', '2023-10-21', '2023-12-21', 'El presente curso vacacional de natación va dirigido a la población de niños comprendidos entre las edades de 6 a 17 años en ambos géneros, femenino y masculino, nuestro segmento principal es la población de la ciudad de Quetzaltenango y sus alrededores así mismo prestar el servicio del curso de natación a otros departamentos cercanos.', 1, '2023-10-11 14:54:07', '2024-01-03 14:00:59'),
(3, 'Curso Vacacional  de Matronatación', '2023-10-21', '2023-12-21', 'El curso de vacacional permite brindar una estimulación acuática a los niños desde los 6 meses de edad hasta los 5 años, dicho curso vacacional de matronatación tendrá una duración de dos meses, y permite brindar una enseñanza-aprendizaje que respete el desarrollo evolutivo físico, cognitivo y social de cada niño, propiciando un entorno seguro y cálido para la correcta adaptación al medio', 1, '2023-10-11 15:01:25', '2024-01-03 14:01:18'),
(4, 'Curso Intensivo', '2023-11-13', '2023-12-15', 'El presente curso vacacional Intensivo tiene un costo único de Q 450. con una duración de 5 semanas, de lunes a viernes, dando inicio  el 13 de noviembre  y  finaliza el  15 de diciembre del presente año.', 1, '2023-11-06 14:44:52', '2023-11-06 15:49:01'),
(5, 'MATRONATACIÓN 2024', '2024-01-08', '2024-12-21', 'El curso de vacacional permite brindar una estimulación acuática a los niños desde los 6 meses de edad hasta los 5 años, el curso anual de  matronatación, permite brindar una enseñanza-aprendizaje que respete el desarrollo evolutivo físico, cognitivo y social de cada niño, propiciando un entorno seguro y cálido para la correcta adaptación.', 1, '2023-12-08 19:31:32', '2024-01-02 16:15:57'),
(6, 'MATRONATACIÓN 2024', '2024-01-08', '2024-12-16', 'El curso de vacacional permite brindar una estimulación acuática a los niños desde los 6 meses de edad hasta los 5 años, el curso anual de  matronatación, permite brindar una enseñanza-aprendizaje que respete el desarrollo evolutivo físico, cognitivo y social de cada niño, propiciando un entorno seguro y cálido para la correcta adaptación.', 0, '2023-12-08 19:31:34', '2023-12-08 19:32:33'),
