INSERT INTO `noticias` (`id`, `titulo`, `imagen`, `contenido`, `created_at`, `updated_at`) VALUES
(2, 'CEREMONIA DE RECONOCIMIENTO A DESTACADOS 2023', '1706224860.jpeg', '<p>𝐀𝐓𝐋𝐄𝐓𝐀𝐒 𝐃𝐄𝐒𝐓𝐀𝐂𝐀𝐃𝐎𝐒 𝟐𝟎𝟐𝟑 <img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t52/1/16/1f3ca_1f3fb_200d_2640.png\" alt=\"🏊🏻‍♀️\" width=\"16\" height=\"16\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t69/1/16/1f3ca.png\" alt=\"🏊\" width=\"16\" height=\"16\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tf4/1/16/2728.png\" alt=\"✨\" width=\"16\" height=\"16\"></p><p>Los atletas quetzaltecos:</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t52/1/16/1f3ca_1f3fb_200d_2640.png\" alt=\"🏊🏻‍♀️\" width=\"16\" height=\"16\"> Alejandra Alvarado</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t69/1/16/1f3ca.png\" alt=\"🏊\" width=\"16\" height=\"16\"> Paolo Pira</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t52/1/16/1f3ca_1f3fb_200d_2640.png\" alt=\"🏊🏻‍♀️\" width=\"16\" height=\"16\"> Linda de León</p><p><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t69/1/16/1f3ca.png\" alt=\"🏊\" width=\"16\" height=\"16\"> Pablo Ortiz</p><p>Fueron nominados como atletas destacados del Departamento de Quetzaltenango en la disciplina de Natación y Aguas Abiertas, para la ceremonia de reconocimiento a atletas Destacados 2023, por la Federación Nacional de Natación de Guatemala <img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t37/1/16/1f1ec_1f1f9.png\" alt=\"🇬🇹\" width=\"16\" height=\"16\"></p><p>Felicítamos a los atletas por el logro alcanzado<img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/ta8/1/16/1f396.png\" alt=\"🎖️\" width=\"16\" height=\"16\">, a los padres de familia y entrenadores que son parte fundamental para que los atletas puedan alcanzar sus objetivos <img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tf4/1/16/2728.png\" alt=\"✨\" width=\"16\" height=\"16\"></p>', '2024-01-25 22:21:00', '2024-01-25 22:21:00'),
(3, 'MASTERS 2024', '1707584789.jpg', '<p>MASTERS PRESENTES EN LAS COMPETENCIAS DEL CICLO 2024</p>', '2024-02-10 16:06:29', '2024-02-10 16:06:29');
